import food from '../food.png'
const Navbar = () => {
    return (
        <nav>
            <div className="logo">
                <Link to="/"><img src={food} alt="logo" /></Link>
                <h1>KFC Food</h1>
            </div>
            <div className="navlinks">
                <a href="/addfood">Add food</a>
                <a href="/orders">Orders</a>
            </div>
        </nav>
    );
}

export default Navbar;
